import React from 'react';
import { createGlobalStyle } from 'styled-components';
import styled from 'styled-components';

const GlobalStyle = createGlobalStyle`
  :root {
    /* Spacing */
    --space-1: 3rem;
    --space-2: 4rem;

    /* Typography */
    --default-font-size: 1.6rem;
    --font-family-stack: 'Source Sans Pro', 'Roboto', sans-serif;

    /* Colors */
    --primary-color: #255ED6;

    --ui-01: #EFF0F5;
    --ui-02: #2A2D39;
    --ui-03: #E4E7F1;
    --ui-04: #969EB5;
    --ui-05: #474954;

    --text-color-dark: var(--ui-02);
    --text-color-medium: var(--ui-05);
    --text-color-light: var(--ui-04);

    /* Icon colors */
    --icon-color-dark: var(#969EB5);

    /* Theming */
    --body-background-color: var(--ui-01);
  }

  *,
  *::after,
  *::before {
    margin: 0;
    padding: 0;
    box-sizing: inherit;
  }

  html {
    box-sizing: border-box;
    font-size: 62.5%; // 62.5% === 10px / 16px
  }

  body {
    font-size: var(--default-font-size);
    font-family: var(--font-family-stack);
    background-color: var(--body-background-color);
  }

  /* button resets */
  button {
    outline: none;
    border: none;

    &:focus {
      outline: none;
    }
  }
`;

export default function App() {
  return (
    <>
      <GlobalStyle />
      <SmoothCorner>circles</SmoothCorner>
      <Blob />
    </>
  );
}

const Blob = () => {
  const SVGContainer = styled.svg`
    position: fixed;
    top: 0;
    right: 0;
  `;

  return (
    <SVGContainer width="139" height="243" xmlns="http://www.w3.org/2000/svg">
      <g fill="none" fillRule="evenodd">
        <path fill="#D9DEF0" d="M36.176 0H0l39.06 206.111z" />
        <path
          d="M34 0v211.935c2.52 20.46 17.206 30.69 44.059 30.69h60.898V0"
          fill="#255ED6"
        />
      </g>
    </SVGContainer>
  );
};
